import React from 'react';
import { Link } from 'react-router-dom';

export default function Feature({ title, desc, to, img }) {
  return (
    <Link
      to={to}
      className="p-2 bg-white shadow rounded text-center hover:shadow-md transition cursor-pointer block"
      style={{ minWidth: 120, minHeight: 120, maxWidth: 160 }}
    >
      {img && (
        <img
          src={img}
          alt={title + ' icon'}
          className="mx-auto mb-1 w-7 h-7 object-contain"
        />
      )}
      <h3 className="text-base font-semibold mb-1 text-blue-600">{title}</h3>
      <p className="text-xs text-gray-500">{desc}</p>
    </Link>
  );
}
